import React from 'react'
import {useFetchye} from 'fetchye'

function Joke() {
   const[isLoading, data, error] =  fetchye('https://api.chucknorris.io/jokes/random')

     const joke = data && data.body

    if(isLoading) {
        return <div>Loading...</div>
    }
    if(error) {
        return <div>{error.message}</div>
    }



    return (
        <div>
            {joke && joke.value}
        </div>
    )
}

export default Joke
